import React from 'react';
import { Link } from 'react-router-dom';
import "./header.css"

/**
* @author
* @function Header
**/

export const Header = (props) => {
    return (
        <>
            <header className="header">
                <nav className="header-menu">
                    <Link to="./home/home">Home</Link>
                    <Link>Bollywood</Link>
                    <Link>Hollywood</Link>
                    <Link>Technology</Link>
                </nav>
                <div>
                    Login/Logout Stuff
                </div>
            </header>
        </>
   )

}
 
export default Header;
